const List = (props) => {
    return (
        <div>
            <table>
                <tr>
                    <th>Name:</th>
                    <th>Age:</th>
                </tr>
                {props.members.map(mapToTable)}
            </table>
        </div>
    )
}

const mapToTable = (member) => {
    return <tr>
        <td>member.name</td>
        <td>member.age</td>
    </tr>
}

export default List;
